import NavBar from "./NavBar";
import {pin} from "../data/location"
export default function History(){
    pin.reverse()
    return (
        <>
            <NavBar/>
            <table>
                <thead>
                    <tr>
                        <th>S.No.</th>
                        <th>Date & Time</th>
                        <th>Latitude</th>
                        <th>Longitude</th>
                        <th>Maps</th>
                    </tr>
                </thead>
                <tbody>
                    {pin.map((day) => {
                        return (
                            <tr>
                                <td>{day}</td>
                                <td>{day.date}</td>
                                <td>{day.latitude}</td>
                                <td>{day.longitude}</td>
                            </tr>
                        )
                    })}
                </tbody>

            </table>
        </>
    )
}
